window.bookSummaryJSON = "<p>Sabrina Daley's world is turned upside down when a local psychic predicts that her missing sister will be found.</p> <p>Unfortunately, the psychic, Miss Terri, is unable to provide any further details.</p> <p>Desperate for something more to work with, Sabrina shows up at Miss Terri's house the next day, ready to beg for another psychic reading. Instead, Sabrina finds Miss Terri's lifeless body.</p> <p>So when the local police have trouble solving Terri's murder, Sabrina sets out to bring the psychic's killer to justice before they strike again.</p>"; 
